import React, { useState } from 'react';

const SurveillanceForm = () => {
  const [formData, setFormData] = useState({
    patientName: '',
    patientID: '',
    age: '',
    gender: '',
    dateOfAdmission: '',
    dateOfProcedure: '',
    admittingDepartment: '',
    departmentPrimarySurgeon: '',
    procedureName: '',
    diagnosis: '',
    procedureDoneBy: '',
    operationTheatre: '',
    outpatientProcedure: '',
    scenarioProcedure: '',
    woundClass: '',
    papGiven: '',
    durationPAP: '',
    ssiEventOccurred: '',
    dateOfEvent: ''
  });

  const departments = [
    'Cardiothoracic Surgery', 'Internal Medicine', 'Anesthesia', 'Cardiology', 
    'Hemato-Oncology & Bone Marrow Transplant', 'Liver Transplant & Surgical Gastroenterology',
    'Oncology', 'GI & Hepato-Pancreatico-Biliary Surgery', 'Critical Care', 
    'Pulmonary Medicine & Critical Care', 'Radiodiagnosis & Imaging', 'Nephrology', 
    'Urology & Renal Transplant', 'Plastic & Aesthetic Surgery', 'Gastroenterology', 
    'Orthopedics & Joint Replacement', 'NeuroSciences', 'Pediatric', 'Laboratory Medicine',
    'Endocrinology', 'General & Minimally Access Surgery', 'Obstetrics & Gynaecology',
    'Dental Department', 'Nuclear Medicine', 'Dermatology', 'Rheumatology', 'IVF & Reproductive Medicine',
    'Orthopedic Spine', 'Onco Surgery', 'Medical Services', 'Ophthalmology', 'ENT', 
    'Respiratory, Critical Care & Sleep Medicine', 'Behavioral Sciences'
  ];

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData({
      ...formData,
      [name]: type === 'checkbox' ? checked : value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData);
  };

  return (
    <div style={{ maxWidth: '900px', margin: '0 auto', padding: '20px', border: '1px solid #ccc', borderRadius: '10px', backgroundColor: '#f9f9f9' }}>
      <h2 style={{ textAlign: 'center', marginBottom: '20px' }}>Surgical Site Infection Surveillance Form</h2>
      <form onSubmit={handleSubmit} style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '15px' }}>
        
        {/* Basic Information */}
        <label>Patient Name:</label>
        <input type="text" name="patientName" value={formData.patientName} onChange={handleChange} />

        <label>Patient ID:</label>
        <input type="text" name="patientID" value={formData.patientID} onChange={handleChange} />

        <label>Age:</label>
        <input type="number" name="age" value={formData.age} onChange={handleChange} />

        <label>Gender:</label>
        <select name="gender" value={formData.gender} onChange={handleChange}>
          <option value="">Select Gender</option>
          <option value="Male">Male</option>
          <option value="Female">Female</option>
          <option value="Other">Other</option>
        </select>

        {/* Date Information */}
        <label>Date of Admission:</label>
        <input type="date" name="dateOfAdmission" value={formData.dateOfAdmission} onChange={handleChange} />

        <label>Date of Operative Procedure:</label>
        <input type="date" name="dateOfProcedure" value={formData.dateOfProcedure} onChange={handleChange} />

        {/* Department Selection */}
        <label>Admitting Department:</label>
        <select name="admittingDepartment" value={formData.admittingDepartment} onChange={handleChange}>
          <option value="">Select Department</option>
          {departments.map((dept, index) => (
            <option key={index} value={dept}>{dept}</option>
          ))}
        </select>

        <label>Department (Primary Surgeon):</label>
        <select name="departmentPrimarySurgeon" value={formData.departmentPrimarySurgeon} onChange={handleChange}>
          <option value="">Select Department</option>
          {departments.map((dept, index) => (
            <option key={index} value={dept}>{dept}</option>
          ))}
        </select>

        {/* Other Fields */}
        <label>Name of Procedure:</label>
        <input type="text" name="procedureName" value={formData.procedureName} onChange={handleChange} />

        <label>Diagnosis:</label>
        <input type="text" name="diagnosis" value={formData.diagnosis} onChange={handleChange} />

        {/* Remaining fields omitted for brevity */}

        <button type="submit" style={{ gridColumn: 'span 2', padding: '10px', backgroundColor: '#007bff', color: '#fff', border: 'none', borderRadius: '5px', cursor: 'pointer', marginTop: '20px' }}>
          Submit
        </button>
      </form>
    </div>
  );
};

export default SurveillanceForm;
